import React from 'react';
import PropTypes from 'prop-types';
import { div } from '../router/div';

// const tecnologies = [ 'HTML5', 'CSS3', 'JavaScript', 'ReactJs',  ];
const description = {
    name: 'Matias',
    age: '31',
    country: 'Argentina'
}
const technologies = ['html5', 'css3', 'javaScript', 'reactJs', 'NextJs' ]

const backgoroundColor = {
    className: 'green-background',
}

export const FirstApp = ({title}) => {


  return (
    <div>
    <h1>{ title }</h1>
    {technologies.map((element, index) => ((
    <div key={index}>
    <p>tecnologies: {element} </p>
    </div>
    )))
    }
    <h2 className={backgoroundColor.className}>Description</h2>
    <ul >
        <li>Name: { description.name }</li>
        <li>Age: { description.age }</li>
        <li>Country: { description.country }</li>
    </ul>
    </div>
  )
}

FirstApp.propTypes = {
 title: PropTypes.string.isRequired, 
}

FirstApp.defaultProps = {
    title: 'App React js',
}
